export default function ProductTable(props) {
  const { products } = props;
  let serialNumber = 0;
  //const totalProducts = data.length;
  //console.log("totalProducts", totalProducts);
  return (
    <div>
      <h2>Manage Products List</h2>
      <h3>Total products-{products.data.length}</h3>
      <div className="col-md-12">
        <table className="table">
          <thead>
            <tr>
              <th>Sl No.</th>
              <th>productId</th>
              <th>product Name</th>
              <th>Stock</th>
              <th>Mrp</th>
              <th>B2BPrice</th>
              <th>discount</th>
              <th>reserveStock</th>
              <th>Status</th>
              <th>categoryId</th>
              <th>Actions</th>
            </tr>
          </thead>
          <tbody>
            {products.data.map((ele) => {
              serialNumber++;
              const productId = `PR${serialNumber.toString().padStart(2, "0")}`;
              return (
                <tr key={productId}>
                  <td>{serialNumber}</td>
                  <td>{productId}</td>
                  <td>{ele.name}</td>
                  <td>{ele.stock}</td>
                  <td>{ele.mrp}</td>
                  <td>{ele.B2BPrice}</td>
                  <td>{ele.discount}</td>
                  <td>{ele.reserveStock}</td>
                  <td>{ele.status}</td>
                  <td>{ele.categoryId}</td>
                  <td>
                    <button>Show</button>
                    <button>edit</button>
                    <button>remove</button>
                  </td>
                </tr>
              );
            })}
          </tbody>
        </table>
      </div>
    </div>
  );
}
